import './WhyUs.css'

import { Accordion, Container } from "react-bootstrap";

function WhyUs(){

    const ArraysOfAccordion = [{
        id: 1,
        title: 'Hello world #1',
        text: 'Just some any words'
    },
    {
        id: 2,
        title: 'Hello world #1',
        text: 'Just some any words'
    }]
    const ArraysOfAccordionOnMap = ArraysOfAccordion.map((ArrayOfAccordion) => 
    <Accordion flush key = {ArrayOfAccordion.id} className = "accord">
        <Accordion.Item>
            <Accordion.Header>
                <h4>{ArrayOfAccordion.title}</h4>
            </Accordion.Header>

            <Accordion.Body>
                <p>{ArrayOfAccordion.text}</p>
            </Accordion.Body>
        </Accordion.Item>
    </Accordion>
    )

    return(
        <Container className = "padding">
            <h1 className = "text-center">Почему именно мы?</h1>

            {ArraysOfAccordionOnMap}

        </Container>
    )
}

export default WhyUs
